void decode_wrapper() {
  bool clean_run = true;
  int n_res_char;
  uint8_t* result = decode(&ofdm, &frame, deinterleaved_bits, &n_res_char);

#ifdef DO_OUTPUT_VALUE_CHECKING
  int max_di = frame.n_data_bits;
  for (int di = 0; (di < max_di) && clean_run; di++) {
    if (result[di] != EXPECTED_RESULT[di]) {
      printf("Miscompare: result[%d] = %u vs %u = EXPECTED_VALUE[%d]\n", di, result[di], EXPECTED_RESULT[di], di);
      clean_run = false;
    }
  }
  if (clean_run) {
    printf("The output matches expected output!\n");
  }
#endif

  if (clean_run) {
    printf("All viterbi iteration tests passed!\n\n");
  } else {
    printf("ERROR: Mismatch versus verification data found!\n\n");
    exit(-2);
  }
}

int main() {
  decode_wrapper();
}
